import React from 'react';
import { Card, ListGroup } from 'react-bootstrap';

export default function Receipt(props) {

    const { order } = props;
    console.log(order);
    let body = <Card.Body>
        <Card.Text></Card.Text>
    </Card.Body>;

    let date = new Date(order.Date);
    let dateString =  date.getMonth() + '/' + date.getDate() + '/' + date.getFullYear();

    return(
        <Card style={{width: 350, marginLeft: '20%', marginTop: 10}}>
            <Card.Body>
                <Card.Header>{order.CustomerName}<br/>Receipt ID: {order.OrderId}<br/>Date: {dateString}</Card.Header>


                <ListGroup variant="flush">
                    {order.Items.map((item) => {
                        return <ListGroup.Item>{item.Quantity}x {item.ItemName}: ${item.Price}</ListGroup.Item>
                    })}
                </ListGroup>
            </Card.Body>
        </Card>
    );
}
